{"source":{"uri":"features/spec/buscar_produto.feature","data":"#language: pt\n\n@regression\nFuncionalidade: Busca um produto \n    COMO úsuario do Ecommerce Automation Practice\n    QUERO buscar por um produto específico\n    PARA poder comprar o produto desejado\n\n    Contexto: Estar na Home\n        Dado que esteja na home\n    \n    @search_for_product\n    Cenário: Buscar por produtos existentes\n        Quando fazer uma busca por um estilo ou produto específico\n        Então deve ser retornado os resultados da busca","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/spec/cart.feature","data":"#language: pt\n\n@regression\nFuncionalidade: Carrinho \n    COMO usuário do sistema\n    QUERO adicionar produtos ao meu carrinho\n    PARA poder finalizar a compra\n\n    Contexto:\n        Dado que esteja na home\n        Quando fazer uma busca por um estilo ou produto específico\n        E acessar a página do produto\n    \n    @purchase\n    Cenário: Fazer a compra \n        Quando adicionar o produto ao carrinho e finalizar a compra\n        Então tela de comfirmação deve aparecer ","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/spec/login.feature","data":"#language: pt \n\n@regression\n@login_registration\nFuncionalidade: login e cadastro \n    COMO usuário do sistema\n    QUERO me autenticar na aplicação  \n    PARA realizar compras \n\n    Contexto:\n        Dado que esteja na home\n        E avance para a pagina de autenticação\n        \n    @registration\n    Cenário: Cadastrar-se no sistema\n        Quando preencher o campo de e-mail \n        Então realizar o cadastro preenchendo os campos \n        Então deve cadastrar o usuário ao sistema\n\n    @login\n    Esquema do Cenário: Fazer login no sistema \n        Quando realizar o login com senha e e-mail\n        Então usuário deve ser logado\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/spec/produto.feature","data":"#language: pt\n\n@regression\nFuncionalidade: Pagina do produto \n    COMO usuário do sistema \n    QUERO mudar a cor, o tamanho e a quantidade de um produto especifico \n    PARA deixar o produto ao meu gosto\n\n    Contexto: \n        Dado que esteja na home\n        Quando fazer uma busca por um estilo ou produto específico\n        E acessar a página do produto\n    @PDP\n    Cenário: Produto\n        Quando mudar a cor, o tamanho e a quantidade do produto\n        Então deverá alternar a imagem do produto","mediaType":"text/x.cucumber.gherkin+plain"}},
